    _delivery = json['delivery'] != null ? json['delivery'].cast<num>() : [];
    if (json['featured'] != null) {
      _featured = [];
      json['featured'].forEach((v) {
        _featured?.add(Featured.fromJson(v));
      });
    }
  }
  List<num>? _delivery;
  List<Featured>? _featured;
Data copyWith({  List<num>? delivery,
  List<Featured>? featured,
}) => Data(  delivery: delivery ?? _delivery,
  featured: featured ?? _featured,
);
